import axios from 'axios';

const fetchStaticPage = page => {

  const pageContent = async function getStaticProps() {

    const data = await axios.get(`https://axiomapi.herokuapp.com/page-${page}`).then(res => {
      let user = res.data;
      console.log(user);

      return {
        props: { user },
        revalidate: 1
      }

    }).catch(err => {
      console.log(err)
    });

    return pageContent;
  }
};

export default fetchStaticPage;
